  false,\n\t\"url\": null,\n\t\"notes\": \"This is the metadata describing the source
  data for the Kentucky Geologic Map Web Service (http://kgs.uky.edu/arcgis/rest/services/KY_Geo/MapServer)
  which displays the 1:500,000-scale geologic map of Kentucky at scales smaller than
  1:100,000, and 1:24,000-scale geological quadrangle data at larger scales. The 1:500,000-scale
  geologic map data were derived from the 1988 Geologic Map of Kentucky, which was
  compiled by Martin C. Noger (KGS) from the 1981 Geologic Map of Kentucky (Scale
  1:250,000) by McDowell and others (USGS). The 1:24,000-scale geologic map data and
  the fault data were compiled from 707 Geological Survey 7.5-minute geologic quadrangle
  maps, which were digitized during the Kentucky Geological Survey Digital Mapping
  Program (1996-2006). Dominant lithology is a map layer derived from the geologic
  formations layers. For more information or to download the Metadata compilation
  for this data, see links provided.  \",\n\t\"license_title\": null,\n\t\"extras\":
